import React, { useState } from "react";
import Button from "@material-ui/core/Button";
import AddIcon from '@material-ui/icons/Add';


const ToDoApp = () => {
    let [Data , newData] = useState("");
    let [storeData , newStoreData] = useState([]);

    const inputField = (event) => {
        newData(event.target.value);
    }

  return (
    <>
      <div className="center_div">
        <h1>ToDoApp</h1>
        <br />
        <input type="text" value = {Data} onChange = {inputField} placeholder="Add an Item" />
        <Button variant="contained" title="Save Item" className="newBtn">
          <AddIcon/>
        </Button>
      </div>
    </>
  );
};
export default ToDoApp;
